import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

import { Card, CardContent, CardActions, Button } from '@mui/material';
import ImageService, { Image_Post } from './Services/ImageService';

const PostList = () => {
  const navigate = useNavigate();
  const [posts, setPosts] = useState<Image_Post[]>([]);

  useEffect(() => {
    ImageService.getImage().then((data) => {
      setPosts(data.data);
    });
  }, []);

  const handleAddPost = () => {
    navigate('../imagepost/create');
  };



  return (
    <>
      {posts.map((post) => (
        <div key={post.id}>
          <Card sx={{ minWidth: 275 }}>
            <CardContent>
              <h2>{post.image}</h2>
              <p>{post.description}</p>
              <CardActions>
                <Button
                  size='small'
                  color='primary'
                  variant='contained'
                  onClick={() => handleAddPost()}
                >
                  Edit
                </Button>
               
              </CardActions>
            </CardContent>
          </Card>
        </div>
      ))}
      <Button
        size='small'
        color='success'
        variant='contained'
        onClick={handleAddPost}
      >
        Add Post
      </Button>
    </>
  );
};

export default PostList;
